constructor(credentials: PayPalCredentials, engine: HttpClientEngineFactory<HttpClientEngineConfig>, customJson: Json = Json {
        encodeDefaults = true
        isLenient = true
        allowSpecialFloatingPointValues = true
        allowStructuredMapKeys = true
        prettyPrint = true
        useArrayPolymorphism = true
        ignoreUnknownKeys = true
    }, httpClient: HttpClient = HttpClient(engine) {
        defaultRequest {
            url(if (credentials.isSandbox) "https://api-m.sandbox.paypal.com/" else "https://api-m.paypal.com/")
            headers {
                append(HttpHeaders.ContentType, ContentType.Application.Json)
            }
        }
        install(ContentNegotiation) {
            json(customJson)
        }
    })

